import Sidebar from '../components/Sidebar';

export default function Home() {
  return (
    <div className="main">
      <Sidebar />
      <div className="content">
        <button>Upload Files</button>
        <button>Upcoming Assessments</button>
        <button>Take Quiz</button>
        <button>Result</button>
      </div>
    </div>
  );
}
